import React from 'react';
import { withStyles, makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';
import { Button } from '@material-ui/core';

const Axios = require('axios')

const StyledTableCell = withStyles((theme) => ({
  head: {
    backgroundColor: '#333',
    color: '#E5E5E5',
    fontSize: 17
  },
  body: {
    fontSize: 15,
  },
}))(TableCell);

const StyledTableRow = withStyles((theme) => ({
  root: {
      backgroundColor: '#E5E5E5',
  },
}))(TableRow);

const getRegisteredData  = async() => { 
    let getData =  await Axios.get('/api/get/getPlates')
    return(getData.data)
}

function createData(name, platenumber, type, actions) {
  return { name, platenumber, type, actions };
}

let rows = [

];

getRegisteredData().then((data) => {
    data.forEach((d, i) => {
        if(d.isActive){
        rows.push(createData('Alec Lawlor', '123456', 'Parent', [<Button>Edit</Button>, <Button>Delete</Button>]))
        }
    })
})


const useStyles = makeStyles({
  table: {
    minWidth: 700,
    maxHeight: '200px'
  },
});

export default function CustomizedTables() {
  const classes = useStyles();

  return (
    <TableContainer component={Paper}>
      <Table className={classes.table} aria-label="customized table">
        <TableHead>
          <TableRow>
            <StyledTableCell>Name</StyledTableCell>
            <StyledTableCell align="left">Type</StyledTableCell>
            <StyledTableCell align="left">Plate Number</StyledTableCell>
            <StyledTableCell align="right">Actions</StyledTableCell>
          </TableRow>
        </TableHead>
        <TableBody style={{maxHeight: '200px', overflow: 'scroll'}}>
          {rows.map((row, i) => (
            <StyledTableRow key={i}>
              <StyledTableCell component="th" scope="row">
                {row.name}
              </StyledTableCell>
              <StyledTableCell align="left">{row.type}</StyledTableCell>
              <StyledTableCell align="left">{row.platenumber}</StyledTableCell>
              <StyledTableCell align="right">{row.actions}</StyledTableCell>
            </StyledTableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );
}
